I have discussed with students in my courses on [Political Violence](https://michaelzeller.de/course-pv/) and on [Far-Right Socio-Politics](https://michaelzeller.de/course-fr/) facets of domestic terrorism and violent extremism. Recently, I was reminded of a dataset produced by the University of North Carolina (UNC) on *Racially and Ethnically Motivated Violent Extremism (REMVE) and Targeted Violence Arrests 2011-2020* (introduced in a brief blog here: <https://www.opendemocracy.net/en/countering-radical-right/documenting-domestic-terrorism-us-new-dataset-exposes-legal-response/>). The dataset consists of manually coded observations of "individuals arrested and charged for federal [NB: not state level] crimes linked to 'domestic' terrorism stemming from white supremacist, nationalist, accelerationist, and male supremacist ideological cultures and groups." 

Unfortunately, the original dataset publication is no longer available; but fortunately, I had a copy saved. The interactive map^[This Observable JS map was produced with the assistance of Andrew Heiss's tutorial: Heiss, Andrew. 2025. “Using USAID Data to Make Fancy World Maps with Observable Plot.” February 10, 2025. <https://doi.org/10.59350/c0aep-hp989>.] below represents the full dataset. By hovering over a state, one can see how many REMVE federal arrests were made there over the 2010s. 




::: {.cell}

:::



