Plot.plot({
  marks: [
    // Plot.frame({ stroke: "black", strokeWidth: 1} ),
    Plot.geo(map_us, Plot.centroid({
      fill: d => state_totals.get(d.properties.name),
      channels: { 
        State: d => d.properties.name, 
      }, 
      tip: { 
        fontSize: 14, 
        format: { 
          State: true, 
          fill: d => format_arrests_total(d) 
        } 
      } 
    })),
    Plot.geo(map_us, {
      stroke: "black",
      strokeWidth: 0.5
    })
  ],
  // https://observablehq.com/@observablehq/plot-cheatsheets-colors
  x:{axis:null},
  y:{axis:null},
  color: {  
    scheme: "reds",  
    unknown: "#f2f2f2",  
    type: "log",   // "linear"
    legend: true,  
    label: "Total REMVE arrests",  
    style: { 
      "font-size": "16px" 
    } 
  }
})

```

::: {.cell}

:::




The dataset contains **675** rows (i.e. arrests), most of which proceeded through to charges, indictment, and sentencing. **548** of the named individuals are males, compared to **113** females. The average age, where this information is available (in 77.9% of cases), is **37** years old.

The dataset also contains, albeit inconsistently, with several missing values, dates of arrest, charging, indictment, and sentencing. These data are reflected in the bar graphs below.

