The full dataset includes individual's names and personal details. Some of the legal proceedings involving these individuals were still pending when the data was collected. Since I am not certain how (or if!) these cases concluded, I will not publish the full identifiable information---just the demographic and procedural details in the sortable table below. One other particularly interesting element is contained in the original dataset: the group affiliation(s) of the arrested individuals. If time allows, I will do further work to pick out these data and represent them.



::: {.cell}
::: {.cell-output-display}

